import "./UserCard.css";

const UserCard = (props) => {
  const { avatar_url, name, login, location, bio, followers, following } =
    props.data;

  return (
    <div className="card">
      <img
        className="usercard__avatar"
        src={avatar_url}
        alt={`Foto de perfil de ${name}`}
      />
      <strong>{name}</strong>
      <p>@{login}</p>
    </div>
  );
};

export default UserCard;
